import { Button } from '@mui/material';
import React from 'react';

const Home = () => {
  return (
    <div>
      <Button variant="text">Text</Button>
      <Button variant="contained">Contained</Button>
      <Button variant="outlined" color="primary">
        Outlined
      </Button>
    </div>
  );
};

export default Home;
